            <p style={{ fontSize: '20px', color: '#666', marginBottom: '10px' }}>Click here to select photos</p>
            <p style={{ fontSize: '18px', color: '#666' }}>‡§´‡•ã‡§ü‡•ã ‡§ö‡•Å‡§®‡§®‡•á ‡§ï‡•á ‡§≤‡§ø‡§è ‡§Ø‡§π‡§æ‡§Å ‡§ï‡•ç‡§≤‡§ø‡§ï ‡§ï‡§∞‡•á‡§Ç</p>
          </div>
        )}
