            border: 'none',
            borderRadius: '10px',
            cursor: selectedPhotos.length > 0 ? 'pointer' : 'not-allowed'
          }}
        >
          ‚¨ÜÔ∏è Upload Photo
          <br />
          ‡§´‡•ã‡§ü‡•ã ‡§Ö‡§™‡§≤‡•ã‡§° ‡§ï‡§∞‡•á‡§Ç
